import { useQuery } from "react-query";
import { useLocation } from "react-router-dom";
import styled from "styled-components";
import { MoreImages } from "../apis/api";

const Wrapper = styled.div`
    display: flex;
    flex-wrap: wrap;
    width: 100%;
    font-family: "kcc";
`;

const ImgBoxs = styled.div`
    font-size: 25px;
    margin-top: 20px;
    margin-bottom: 20px;
`;

const Img = styled.img`
    width: 200px;
    height: 200px;
`;

interface Idata {
    // [key: number]: any,
    contentid: number,
    originimgurl: string,
    imgname: string,
    smallimageurl: string,
    cpyrhtDivCd: string,
    serialnum: string
}


function MoreImg() {
    const location = useLocation();
    const searchParams = new URLSearchParams(location.search);
    const contentId = Number(searchParams.get("id"));
    const { data: imgData } = useQuery<Idata[]>(
        ["img"], async () => {
            const data = await MoreImages(contentId);
            return data.response.body.items.item;
        }
    );
    console.log(imgData);
    return (
        <Wrapper>
            <ImgBoxs>
                <Img src={imgData?.[0].originimgurl} />
            </ImgBoxs>
        </Wrapper>
    );
}

export default MoreImg;
